import React from 'react'
import PropTypes from 'prop-types'

const Events = (props) => {
  return (
    <div>
      <ul>
        { 
          props.eventsDatas.map(event => {
            return <li>
              {event.description.html}
            </li>
          })
        }
      </ul>
    </div>
  )
}

export default Events
